import React from 'react'

function CovidTracker() {
  return (
    <div>CovidTracker</div>
  )
}

async function getdata(){
    const data = await fetch('https://data.covid19india.org/v4/min/data.min.json');
    console.log(data);
}
getdata();

export default CovidTracker;
